import React from 'react'
import * as THREE from 'three';


function background() {
    (function(window, document) {
        window.addEventListener('load', loadTexture, false);
        function init() {
            createScene();
            createCurve();
            createTube();
            document.addEventListener('mousemove', handleMouseMove, false);
            loop();
        }
        // Mouse move handle ---------------------------------------------------------
        var mousePos = {x: 0, y: 0};
        function handleMouseMove (event) {
            var tx = (event.clientX - (WIDTH / 2)) / (WIDTH / 2);
            var ty = ((HEIGHT / 2) - event.clientY) / (HEIGHT / 2);
            mousePos = {x: tx, y: ty};
        }
        // Scene ---------------------------------------------------------
        var scene,
                camera, fieldOfView, aspectRatio, nearPlane, farPlane, HEIGHT, WIDTH,
                renderer, container;
        function createScene() {
            WIDTH = window.innerWidth;
            HEIGHT = window.innerHeight;
            // scene
            scene = new THREE.Scene();
            scene.fog = new THREE.Fog(0x222222, 0.6, 2.8);
            // camera
            aspectRatio = WIDTH / HEIGHT;
            fieldOfView = 15;
            nearPlane = 0.01;
            farPlane = 1000;
            camera = new THREE.PerspectiveCamera(
                fieldOfView,
                aspectRatio,
                nearPlane,
                farPlane
            );
            camera.rotation.y = Math.PI;
            camera.position.z = 0.35;
            // render
            renderer = new THREE.WebGLRenderer({
                antialias: true
            });
            renderer.setClearColor(0x222222);
            renderer.setSize(WIDTH, HEIGHT);
            // container
            container = document.getElementById('world');
            container.appendChild(renderer.domElement);
            // listen resize
            window.addEventListener('resize', handleWindowResize, false);
        }
        function handleWindowResize () {
            WIDTH = window.innerWidth;
            HEIGHT = window.innerHeight;
            renderer.setSize(WIDTH, HEIGHT);
            camera.aspect = WIDTH / HEIGHT;
            camera.updateProjectionMatrix();
        }
        // Lights ---------------------------------------------------------
        var directionalLight, light;
        function createLights () {
            light = new THREE.HemisphereLight( 0xffffbb, 0x887979, 0.9);
            scene.add( light );
            directionalLight = new THREE.DirectionalLight( 0xffffff, 0.8 );
            scene.add( directionalLight );
        }
        // Load texture ---------------------------------------------------------
        var texture;
        function loadTexture () {
            var image = new Image();
            image.src = 'data:image/jpeg;base64,';
            texture = new THREE.Texture();
            texture.image = image;
            image.onload = function() {
                texture.needsUpdate = true;
                init();
            };
        }
        // Curve ---------------------------------------------------------
        var curve;
        function createCurve () {
            var points = [];
            for (var i = 0; i < 5; i++) {
                points.push(new THREE.Vector3(0, 0, 3 * (i / 4)));
            }
            points[4].y = -0.06;
            curve = new THREE.CatmullRomCurve3(points);
        }
        // Tube geometry ---------------------------------------------------------
        var tube, spline, tubeGeometry_o;
        function createTube () {
            var tubeGeometry = new THREE.TubeGeometry(curve, 70, 0.02, 30, false);
            var tubeMaterial = new THREE.MeshBasicMaterial({
                side: THREE.BackSide,
                map: texture
            });
            tubeMaterial.map.wrapS = THREE.MirroredRepeatWrapping;
            tubeMaterial.map.wrapT = THREE.MirroredRepeatWrapping;
            tubeMaterial.map.repeat.set(10, 4);
            tube = new THREE.Mesh(tubeGeometry, tubeMaterial);
            scene.add(tube);
            var geometry = new THREE.Geometry();
            geometry.vertices = curve.getPoints(70);
            spline = new THREE.Line(geometry, new THREE.LineBasicMaterial());
            tubeGeometry_o = tubeGeometry.clone();
        }
        // Material offset ---------------------------------------------------------
        function updateMaterialOffset () {
            tube.material.map.offset.x += 0.005;
        }
        // Update curve ---------------------------------------------------------
        function updateCurve () {
            var index = 0, vertice_o = null, vertice = null;
            for (var i = 0; i < tube.geometry.vertices.length; i++) {
                vertice_o = tubeGeometry_o.vertices[i];
                vertice = tube.geometry.vertices[i];
                index = Math.floor(i / 50);
                vertice.x += (vertice_o.x + spline.geometry.vertices[index].x - vertice.x) / 10;
                vertice.y += (vertice_o.y + spline.geometry.vertices[index].y - vertice.y) / 10;
            }
            tube.geometry.verticesNeedUpdate = true;
            curve.points[2].x = mousePos.x * 0.2;
            curve.points[4].x = mousePos.x * 0.2;
            curve.points[2].y = mousePos.y * 0.2;
            spline.geometry.verticesNeedUpdate = true;
            spline.geometry.vertices = curve.getPoints(70);
        }
        // Loop ---------------------------------------------------------
        function loop () {
            updateMaterialOffset();
            updateCurve();
            renderer.render(scene, camera);
            requestAnimationFrame(loop);
        }
    })(window, document);
}

export default background
